import React, {useEffect, useState} from 'react';
import Floor from './components/Floor';
import Block from './components/Block';
import TileFrame from './components/TileFrame';
import './css/stylesheet.css';

const App = () => {


    useEffect( () => {
        console.log("runing useEffect");
        const timer = setTimeout(run, 3000);
        function run() {
            console.log("setting to true");
            setStarted(true);
            setBottom(true);
            clearInterval(timer);
        }
    }, []);

    const [score, setScore] = useState(0);
    const [highScore, setHighScore] = useState(0);
    const [firstTime, setFirstTime] = useState(true);
    const [ended, setEnded] = useState(false);
    const [height, setHeight] = useState(100);
    const [bottom, setBottom] = useState(false);
    const [initialTilePos, setInitialTilePos] = useState(50);
    const [firstTilePos, setFirstTilePos] = useState(50);

    return (
        <div className="ui container" >
            <Floor setScore={setScore} setHighScore={setHighScore} setStarted={setStarted} setEnded={setEnded}/>
            <TileFrame firstTime={firstTime} bottom={bottom} setInitialTilePos={setInitialTilePos} setFirstTilePos={setFirstTilePos}/>
            <Block height={height} setHeight={setHeight} bottom={bottom} setBottom={setBottom} initialTilePos={initialTilePos} firstTilePos={firstTilePos} firstTime={firstTime}/>
        </div>
    )

};

export default App;
